import React from 'react';

import './About.css';

export default props => {
    return(
        <div>
            <Container>
                <Row>
                    <Col xs={12} sm={12} md={12} lg={12}>
                        <h1>Hi! My name is Lichelle</h1>
                        <h2>I'm a designer, developer, and computer networks specialist</h2>
                    </Col>
                </Row>
            </Container>
        </div>
    );
}
